import React, { useContext } from 'react';

import { ProductContext } from '../../hoc/MainRouter';

const ItemsOpenOrder = () => {
  const [checkout] = useContext(ProductContext);
  console.log(
    'This is our Checkout',
    checkout.map((x) => x.name)
  );

  return (
    <div className="open-orders-container">
      <div className="open-orders-h1">
        <h2>Offene Bestellungen</h2>
        <span>see all</span>
      </div>
      <div className="items-container">
        <h3>

          {checkout
            ? checkout.map((item) => {
                item.name;
              })
            : 'no checkout'}
        </h3>
        <h5>Category</h5>
        <h6>Order Date</h6>
      </div>
    </div>
  );
};

export default ItemsOpenOrder;
